import {Component} from "react";
import * as React from "react";
import './HomePage.scss';
import ServerList from "../ServerList/ServerList";
import Icon from "../components/Icon/Icon";
import {localStorageKey} from "../constants/auth.constants";

class HomePage extends Component<any, {}> {
    onLogout() {
        const token = localStorage.getItem(localStorageKey);
        if (!token) {
            console.log('You\'re already logged out');
        } else {
            localStorage.removeItem(localStorageKey);
        }
        this.props.history.push('/sign-in');
    }

    render() {
        return (
            <div>
            <div className="header d-flex align-items-center justify-content-between">
                <button className="logo logo--dark"/>
                <button onClick={this.onLogout} className="btn btn--logout">
                    <Icon name={'logout'} color={'#2F3254'} width={16} height={16}/>
                    <span>Logout</span>
                </button>
            </div>
                <ServerList/>
            </div>
        );
    }
}

export default HomePage;
